  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:17.181437\",\n\t\"name\": \"north-mississippi-refuges-complex-2001-annual-narrative\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for North
  Mississippi Refgues (including Dahomey NWR, Tallahatchie NWR, and Coldwater River
  NWR) outlines activities and accomplishments during the 2001 calendar year. The
  report begins with an introduction to the Refuge. Highlights and weather conditions
  are summarized for the year. Information about monitoring and studies- including
  surveys and censuses and studies and investigations- is provided next. Habitat restoration
  and management projects are also covered; activities include wetland restoration,
  water level management, moist soil management, grazing/mowing/haying, and farming.
  Fish and wildlife management are discussed next with emphasis on nest structures
  and animal control. Coordination activities, such as interagency coordination, private
  land activities, and cooperative organizations, are outlined. The resource protection
  section provides an update on law enforcement, wildfire preparedness, and land acquisition
  support. Information about public education and recreation is given including visitor
  services and outreach. Finally, general administration is discussed in the Refuge
  planning and administration section.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
